import React from "react";

function Movie(){
    return (
        <ol>
            <li>Harry Potter</li>
            <li>Lord of the rings</li>
            <li>Star Wars</li>
            <li>Pirates Of the carabian</li>
            <li>Koi mil gaya</li>
        </ol>
    );
}

export default Movie;
